INSERT INTO `email_template_lang` VALUES (1,1,1,NULL,NULL,NULL,NULL,NULL,NULL,'<html>\n<div style=\"margin: 10px 0px 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);\">\nHi $$firstname$$,<br/><br/>\n\nA MAP-Works password was successfully created for your account.If this was not you or you believe this is an error,\nplease contact MAP-Works support at &nbsp;<a class=\"external-link\" href=\"mailto:$$Support_Helpdesk_Email_Address$$\" rel=\"nofollow\" style=\"color: rgb(41, 114, 155); text-decoration: underline;\">$$Support_Helpdesk_Email_Address$$</a><br/><br/>\n\nWe\'re very happy to have you on board, and are here to support you!<br/><br/>\nThank you from the MAP-Works team!\n\n</div>\n</html>','MAP-Works password created [Welcome_Email_Staff]'),(2,2,1,NULL,NULL,NULL,NULL,NULL,NULL,'<html>\n<div style=\"margin: 10px 0px 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);\">\nHi $$firstname$$,<br/></br>\n\nPlease use the link below and follow the displayed instructions to create your new password. This link will expire after $$Reset_Password_Expiry_Hrs$$ hours.<br />\n<br/>\n$$activation_token$$<br/><br/>\n\nIf you believe that you received this email in error or if you have any questions,please contact MAP-works support at <span style=\"color: #99ccff;\">$$Support_Helpdesk_Email_Address$$</span>.<br/><br/>\nThank you from the MAP-Works team!\n </div>\n</html>\n\n','MAP-Works - how to reset your password [Forgot_Password_Staff]'),(3,3,1,NULL,NULL,NULL,NULL,NULL,NULL,'<html>\n 	\n 		<div style=\"margin: 10px 0px 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);\">\n 			Hi $$firstname$$,<br/><br/>\n 		\n 			An update to your MAP-Works account was successfully made. The following information was updated: <br/><br/> \n 		\n 			$$Updated_MyAccount_fields$$\n 		<br/>\n 		\n 			If this was not you or you believe this is an error, please contact MAP-Works support at&nbsp;<a class=\"external-link\" href=\"mailto:support@map-works.com\" rel=\"nofollow\" style=\"color: rgb(41, 114, 155); text-decoration: underline;\">support@map-works.com</a></p>\n 		\n 			<br>Thank you from the MAP-Works team!</br>\n 	</div>\n </html>\n ','MAP-Works profile updated [MyAccount_Updated_Staff]'),(4,4,1,NULL,NULL,NULL,NULL,NULL,NULL,'<?xml version=\"1.0\" encoding=\"utf-8\"?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n    \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<!--[if lte IE 7]> <html class=\"ie7\">\n<style>\n    .ie7 div.forIE7{ margin-left:0px !important;}\n</style>\n <![endif]-->\n<html>\n<head>\n<meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge, chrome=1\" />\n\n</head>\n\n<body>\n	<table cellpadding=\"58\" height=\"337px\" style=\"font-family:helvetica,arial,verdana,san-serif;font-weight:normal;width:900px; text-align:center;\">\n		<tr bgcolor=\"#eeeeee\" style=\"width:900px;padding:0px;\"><td style=\"width:900px;padding:0px;\" >\n		<table style=\"text-align:center;\" style=\"width:100%\">\n		<tr>\n		<td>\n		<table style=\"padding-top:58px;\" style=\"width:100%\">\n		<tr>\n		<td>\n		<div style=\"text-align:center;padding-top:58px;font-size: 33px;height:80px;width:900px;font-family:helvetica,arial,verdana,san-serif;font-weight:normal;color:#000000\">\n			<br>Welcome to MAP-Works.\n		</div>\n		</td>\n		</tr>\n		</table>\n		</td></tr>\n		<tr>\n		<td>\n		<div style=\"text-align:center;font-family:helvetica,arial,verdana,san-serif;font-weight:normal;color:#333333;font-size: 16px;height:16px;padding-top:10px;\">\n			Use the link below to create your password and start using MAP-Works.\n		</div>\n		</td></tr>\n		<tr><table  cellpadding=\"40\" style=\"width:100%\">\n		<td>\n		<div style=\"text-align:center;color: #000000;font-weight:normal;font-size: 20px;\">\n		\n		<div class=\"forIE7\" style=\"margin-left: 322px;\">\n		\n		<table style=\"border-radius:2px;width:175px;font-size:20px;font-family:helvetica,arial,verdana,san-serif;font-weight:normal;text-align:center;padding:15px 0px\">\n		<tbody><tr><td style=\"background-color:#4673a7; height:60px;\"><div style=\"line-height:60px; text-decoration: none; vertical-align: middle;\"><a href=\"$$activation_token$$\" style=\"background-color: #4673a7; color: #ffffff;display: block;height: 60px;text-decoration: none;width:175px \"target=\"_blank\">Sign In Now</a></div></td></tr></tbody></table>\n		</div>\n		\n			<div style=\"margin-left:auto; margin-right:auto;width:100%;font-size: 14px;height:14px;padding-bottom:47px;font-family:helvetica,arial,verdana,san-serif;font-weight:medium;color:#333333;link:#1e73d5;padding-top:10px;\">\n				<span>Use this link to <a target=\"_blank\" style=\"link:#1e73d5;\" href=\"$$activation_token$$\">sign in.</a><span>  \n			</div>\n		</div>\n		</td></table></tr></table>\n		</td></tr>\n\n		<tr><td>\n		<div style=\"text-align:left;margin-left:10px;font-family:helvetica,arial,verdana,san-serif;font-weight:normal;\n			margin-right:18px;font-size: 13px;color: #333333;margin-top:30px;link:#1e73d5;font-weight:normal;\" >\n				<p>Thank you for participating in the spring 2015 pilot. We look forward to hearing your feedback as\n				it will inform future releases of our new student retention and success solution.\n				\n				<br><br>\n				If you have any questions, please contact us here.<br>\n				<a href=\"mailto:$$Support_Helpdesk_Email_Address$$\" style=\"link:#1e73d5;\">$$Support_Helpdesk_Email_Address$$</a> \n				<br><br>\n				Sincerely,\n				<div style=\"text-align:left;font-weight:bold;font-size: 14px;color:#333333\" >\n					<b>The EBI MAP-Works Client Services Team</b> \n					</p>\n				</div>\n		</div>\n		</td></tr>\n\n	</table>\n	</body>\n</html>\n','Map-Works - SignIn Instructions [Create_Password_Coordinator]'),(5,5,1,NULL,NULL,NULL,NULL,NULL,NULL,'<html>\n<div style=\"margin: 10px 0px 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);\">\nHi $$firstname$$,<br/></br>\n\nPlease use the link below and follow the displayed instructions to create your new password. This link will expire after $$Reset_Password_Expiry_Hrs$$ hours.<br />\n<br/>\n$$activation_token$$<br/><br/>\n\nIf you believe that you received this email in error or if you have any questions,please contact MAP-works support at <span style=\"color: #99ccff;\">$$Support_Helpdesk_Email_Address$$</span>.<br/><br/>\nThank you from the MAP-Works team!\n </div>\n</html>\n\n','MAP-Works - how to reset your password [Forgot_Password_Coordinator]'),(6,6,1,NULL,NULL,NULL,NULL,NULL,NULL,'<html>\n<div style=\"margin: 10px 0px 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);\">\nHi $$firstname$$,<br/><br/>\n\nA MAP-Works password was successfully created for your account. If this was not you or you believe this is an error,\nplease contact MAP-Works support at &nbsp;<a class=\"external-link\" href=\"mailto:support@map-works.com\" rel=\"nofollow\" style=\"color: rgb(41, 114, 155); text-decoration: underline;\">support@map-works.com</a><br/><br/>\n\nWe\'re very happy to have you on board, and are here to support you!<br/><br/>\nThank you from the MAP-Works team!\n\n</div>\n</html>','MAP-Works password created [Welcome_Email_Coordinator]'),(7,7,1,NULL,NULL,NULL,NULL,NULL,NULL,'<html>\n<div style=\"margin: 10px 0px 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);\">\nHi $$firstname$$,<br/><br/>\n\nYour MAP-Works password has been changed. If this was not you or you believe this is an error, please contact MAP-Works support at &nbsp;<a class=\"external-link\" href=\"mailto:support@map-works.com\" rel=\"nofollow\" style=\"color: rgb(41, 114, 155); text-decoration: none;\">support@map-works.com</a>\n<br/><br/>\nThank you from the MAP-Works team!\n\n</div>\n</html>','MAP-Works password reset [Sucessful_Password_Reset_Staff]'),(8,8,1,NULL,NULL,NULL,NULL,NULL,NULL,'<html>\n<div style=\"margin: 10px 0px 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Arial, sans-serif; font-size: 14px; line-height: 20px; background-color: rgb(255, 255, 255);\">\nHi $$firstname$$,<br/><br/>\n\nYour MAP-Works password has been changed. If this was not you or you believe this is an error, please contact MAP-Works support at &nbsp;<a class=\"external-link\" href=\"mailto:support@map-works.com\" rel=\"nofollow\" style=\"color: rgb(41, 114, 155); text-decoration: underline;\">support@map-works.com</a>\n<br/><br/>\nThank you from the MAP-Works team!\n\n</div>\n</html>','MAP-Works password reset [Sucessful_Password_Reset_Coordinator]');
